Secure Digital Memory Card (SD) — формат карт памяти (флеш-память), разработанный для использования в основном в портативных устройствах. На сегодняшний день широко используется в цифровых фотоаппаратах и видеокамерах, мобильных телефонах, КПК, коммуникаторах и смартфонах, электронных книгах, GPS-навигаторах и в некоторых игровых приставках. Существуют четыре поколения карт памяти данного формата, различающиеся возможным объёмом данных (совместимы сверху вниз): 
*  SD 1.0 — от 8 МБ до 2 ГБ; 
*  SD 1.1 — до 4 ГБ; 
*  SDHC — до 32 ГБ; 
*  SDXC — до 2 ТБ.

